	case InFullBlock:
		/* #SubCq:R: #gen:quickConstant:operand: #checkQuickConstant:forInstruction: */
		genoperandoperand(SubCqR, 3, ClassReg);
		break;
	case InVanillaBlock:
		/* #SubCq:R: #gen:quickConstant:operand: #checkQuickConstant:forInstruction: */
		genoperandoperand(SubCqR, 3, ClassReg);

		/* #MoveM16:r:R: #gen:quickConstant:operand:operand: #checkQuickConstant:forInstruction: */
		genoperandoperandoperand(MoveM16rR, 0, ClassReg, TempReg);

		/* SubR:R: */
		genoperandoperand(SubRR, TempReg, ClassReg);
		break;
	case 0:
		/* #SubCq:R: #gen:quickConstant:operand: #checkQuickConstant:forInstruction: */
		genoperandoperand(SubCqR, 1, ClassReg);
		break;
