	/* #MoveR:Mw:r: #gen:operand:quickConstant:operand: #checkQuickConstant:forInstruction: */
	genoperandoperandoperand(MoveRMwr, TempReg, 0, ReceiverResultReg);
	offset = smallObjectBytesForSlots(slotSize);

