	genoperandoperand(LogicalShiftRightCqR, log2BytesPerWord(), TempReg);

	/* #SubCq:R: #gen:quickConstant:operand: #checkQuickConstant:forInstruction: */
	genoperandoperand(SubCqR, 4, TempReg);

